export default function Todoinput({texte}) {

    const handleChange = (event) => {
        return event.target.value
    }

    return (
        <div className="appToDo">
        <h1>Add list to do you will do in the day</h1>
        <input id = "todo" type="text" value={texte} onChange={handleChange}/>
        <button type="submit" onClick={handleChange}>Add To do</button>
        </div>
    )
}
